/*Table structure for table `medicamentos` */

DROP TABLE IF EXISTS `medicamentos`;

CREATE TABLE `medicamentos` (
  `clave` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `id_area` int(11) NOT NULL,
  `id_proveedor` int(11) NOT NULL,
  `nombre_gen` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `descripcion_m` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `cantidad_m` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `presentacion` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  PRIMARY KEY (`clave`),
  KEY `proveedores_medicamentos_fk` (`id_proveedor`),
  KEY `areas_medicamentos_fk` (`id_area`),
  CONSTRAINT `fk_areas_medicamentos` FOREIGN KEY (`id_area`) REFERENCES `areas` (`id_area`),
  CONSTRAINT `fk_proveedores_medicamentos` FOREIGN KEY (`id_proveedor`) REFERENCES `proveedores` (`id_proveedor`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

